const OCR_INSTRUCTIONS = `You are an OCR-to-JSON extractor. Return JSON that matches the provided JSON schema exactly.

Task:
• Extract two fields from a label photo:
  1) model_code → the value next to the Korean anchor “모델코드” (or variants: “모델 코드”, “Model code”).
  2) asset_code → the value next to “자산번호” (or variants: “자산 번호”, “Asset No.”, “Asset number”).
• Prefer values physically closest to these anchors on the sticker.
• Ignore S/N / serials / barcodes / QR contents (including anything labeled S/N, Serial, 시리얼, 일련번호).
• Values are alphanumeric with optional - _ /, length 3–32.
• If an anchor or value is missing/unclear, set status: missing_label, missing_value, illegible, uncertain, or not_found.
• Always fill label_seen, and when visible copy the exact anchor text into label_text (may be Korean). Provide up to 3 nearby_text snippets.
• Be conservative: if uncertain, mark status "uncertain" and set confidence accordingly.
• Output English-only for explanations/status; label_text/nearby_text may contain Korean.
• Do not include any text outside the JSON schema.`;

const OCR_OUTPUT_SCHEMA = {
  type: 'object',
  properties: {
    filename: { type: 'string' },
    fields: {
      type: 'object',
      properties: {
        model_code: { $ref: '#/$defs/extractedField' },
        asset_code: { $ref: '#/$defs/extractedField' },
      },
      required: ['model_code', 'asset_code'],
      additionalProperties: false,
    },
    valid: { type: 'boolean' },
    errors: { type: 'array', items: { type: 'string' } },
  },
  required: ['filename', 'fields', 'valid', 'errors'],
  additionalProperties: false,
  $defs: {
    extractedField: {
      type: 'object',
      properties: {
        value: { type: ['string', 'null'], pattern: '^[A-Za-z0-9][A-Za-z0-9\\-_/]{2,32}$' },
        status: {
          type: 'string',
          enum: ['present', 'missing_label', 'missing_value', 'illegible', 'uncertain', 'not_found'],
        },
        confidence: { type: 'number', minimum: 0, maximum: 1 },
        label_seen: { type: 'boolean' },
        label_text: { type: ['string', 'null'] },
        nearby_text: { type: 'array', items: { type: 'string' }, maxItems: 3 },
      },
      required: ['value', 'status', 'confidence', 'label_seen', 'label_text', 'nearby_text'],
      additionalProperties: false,
    },
  },
};

const OCR_EXAMPLE_SOLUTION = {
  filename: 'label1.jpg',
  fields: {
    model_code: {
      value: 'E3012804',
      status: 'present',
      confidence: 0.99,
      label_seen: true,
      label_text: '모델코드',
      nearby_text: ['모델코드', 'E3012804'],
    },
    asset_code: {
      value: 'HBK04724',
      status: 'present',
      confidence: 0.99,
      label_seen: true,
      label_text: '자산번호',
      nearby_text: ['자산번호', 'HBK04724'],
    },
  },
  valid: true,
  errors: [],
};

const FEW_SHOT_IMAGE_DATA_URL =
  'data:image/jpeg;base64,';

const BASE64_ALPHABET = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/';

function arrayBufferToBase64(buffer) {
  const bytes = buffer instanceof ArrayBuffer ? new Uint8Array(buffer) : buffer;
  let result = '';
  let i;
  const len = bytes.length;

  for (i = 0; i + 2 < len; i += 3) {
    const triplet = (bytes[i] << 16) | (bytes[i + 1] << 8) | bytes[i + 2];
    result +=
      BASE64_ALPHABET[(triplet >> 18) & 0x3f] +
      BASE64_ALPHABET[(triplet >> 12) & 0x3f] +
      BASE64_ALPHABET[(triplet >> 6) & 0x3f] +
      BASE64_ALPHABET[triplet & 0x3f];
  }

  if (i < len) {
    const remaining = len - i;
    let triplet = bytes[i] << 16;

    if (remaining === 2) {
      triplet |= bytes[i + 1] << 8;
      result += BASE64_ALPHABET[(triplet >> 18) & 0x3f];
      result += BASE64_ALPHABET[(triplet >> 12) & 0x3f];
      result += BASE64_ALPHABET[(triplet >> 6) & 0x3f];
      result += '=';
    } else {
      result += BASE64_ALPHABET[(triplet >> 18) & 0x3f];
      result += BASE64_ALPHABET[(triplet >> 12) & 0x3f];
      result += '==';
    }
  }

  return result;
}

function formatExampleSolution() {
  return JSON.stringify(OCR_EXAMPLE_SOLUTION);
}

function buildExampleMessage() {
  return {
    role: 'user',
    content: [
      {
        type: 'input_text',
        text: 'EXAMPLE. Filename: label1.jpg\nExtract model_code (모델코드) and asset_code (자산번호) as defined. Prefer printed label text; ignore QR/barcodes. Return JSON only.',
      },
      { type: 'input_image', image_url: FEW_SHOT_IMAGE_DATA_URL },
    ],
  };
}

function buildExampleAssistant() {
  return {
    role: 'assistant',
    content: [
      {
        type: 'output_text',
        text: formatExampleSolution(),
      },
    ],
  };
}

function buildTargetMessage(filename, dataUrl) {
  return {
    role: 'user',
    content: [
      {
        type: 'input_text',
        text: `TARGET. Filename: ${filename}\nExtract model_code (모델코드) and asset_code (자산번호) as defined. Prefer printed label text; ignore QR/barcodes. Return JSON only.`,
      },
      { type: 'input_image', image_url: dataUrl },
    ],
  };
}

function normalizeFieldValue(value) {
  if (typeof value !== 'string') {
    return '';
  }
  return value.trim();
}

function describeField(fieldName, field) {
  const status = field?.status ?? 'unknown';
  const value = normalizeFieldValue(field?.value);
  return `${fieldName}: status=${status}${value ? ` value=${value}` : ''}`;
}

export async function runOcrFallback(env, imageBuffer, options = {}) {
  const apiKey = env?.OPENAI_API_KEY;
  if (!apiKey) {
    throw new Error('OCR fallback is not configured.');
  }

  const filename = options.filename || 'label.jpg';
  const mediaType =
    options.contentType && options.contentType.startsWith('image/') ? options.contentType : 'image/jpeg';
  const base64Payload = arrayBufferToBase64(imageBuffer);
  const dataUrl = `data:${mediaType};base64,${base64Payload}`;

  const payload = {
    model: 'gpt-5-mini',
    max_output_tokens: 1200,
    instructions: OCR_INSTRUCTIONS,
    text: {
      format: {
        type: 'json_schema',
        name: 'asset_label_extraction',
        schema: OCR_OUTPUT_SCHEMA,
        strict: true,
      },
      verbosity: 'medium',
    },
    input: [buildExampleMessage(), buildExampleAssistant(), buildTargetMessage(filename, dataUrl)],
  };

  const response = await fetch('https://api.openai.com/v1/responses', {
    method: 'POST',
    headers: {
      Authorization: `Bearer ${apiKey}`,
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(payload),
  });

  if (!response.ok) {
    const errorText = await safeReadText(response);
    throw new Error(`OCR fallback request failed (${response.status}): ${errorText}`);
  }

  const json = await response.json();
  const output = Array.isArray(json?.output) ? json.output : [];
  const messageEntry = output.find((entry) => entry?.type === 'message');
  const textEntry = Array.isArray(messageEntry?.content)
    ? messageEntry.content.find((item) => item?.type === 'output_text')
    : null;
  if (!textEntry?.text) {
    throw new Error('OCR fallback did not return text output.');
  }

  let parsed;
  try {
    parsed = JSON.parse(textEntry.text);
  } catch (error) {
    throw new Error('OCR fallback returned malformed JSON.');
  }

  const fields = parsed?.fields ?? {};
  const modelField = fields.model_code ?? {};
  const assetField = fields.asset_code ?? {};
  const modelValue = normalizeFieldValue(modelField.value).toUpperCase();
  const assetValue = normalizeFieldValue(assetField.value).toUpperCase();

  if (!modelValue || !assetValue) {
    const parts = [
      describeField('model_code', modelField),
      describeField('asset_code', assetField),
    ];
    if (Array.isArray(parsed?.errors) && parsed.errors.length > 0) {
      parts.push(`errors=${parsed.errors.join('; ')}`);
    }
    throw new Error(`OCR fallback could not extract codes (${parts.join(' | ')}).`);
  }

  return {
    modelCode: modelValue,
    assetTag: assetValue,
    rawCombined: `${modelValue} ${assetValue}`.trim(),
    structured: parsed,
  };
}

async function safeReadText(response) {
  try {
    return await response.text();
  } catch (error) {
    return '[unreadable response body]';
  }
}

export function hasOcrSupport(env) {
  return Boolean(env?.OPENAI_API_KEY);
}
